define('views/FormListItemView',[
	'text!templates/form-list-item.html',

    'marionette',
    'stickit'
], function (
	template
) {
    return Backbone.Marionette.ItemView.extend({
    	tagName: 'li',
    	className: 'form_list_item',
    	template: _.template(template),

    	events: {
    		'click .delete': 'onClickDelete'
    	},

    	bindings: {
    		'input[name="key"]': 'key',
    		'input[name="value"]': 'value'
    	},

    	onClickDelete: function () {
    		this.model.collection.remove(this.model);
    	},

    	onRender: function () {
    		this.stickit();
    	}
    });
});

define('text!templates/form-list-block.html',[],function () { return '<ul class="form_list"></ul>\r\n\r\n<button class="add_field">Add field</button>\r\n<button class="send">Send</button>';});

define('views/FormListCollectionView',[
	'App',
	'views/FormListItemView',
	'text!templates/form-list-block.html',

    'marionette'
], function (
	App,
	FormListItemView,
	template
) {
    return Backbone.Marionette.CompositeView.extend({
    	template: _.template(template),
		itemView: FormListItemView,
		itemViewContainer: '.form_list',

		events: {
			'click .add_field': 'onClickAddField',
			'click .send': 		'onClickSend'
		},

		onClickAddField: function () {
			this.collection.add({});
		},

		onClickSend: function () {
			var self = this;

			$.ajax({
				url: 'http://httpbin.org/post',
				type: 'POST',
				dataType: 'json',
				data: self.serializeCollection(),
				success: function (data) {
					self.collection.reset([{}]);
					App.vent.trigger('requestList:add', data);
				}
			});
		},

		serializeCollection: function() {
			var data = {};

			this.collection.each(function(model) {
				data[model.get('key')] = model.get('value')
			});

			return data;
		}
	});
});
define('models/FormListItemModel',[
    'backbone'
], function () {
    return Backbone.Model.extend({});
});
define('collections/FormListCollection',[
    'models/FormListItemModel',

    'backbone'
], function (
    FormListItemModel
) {
    return Backbone.Collection.extend({
    	url: 'http://httpbin.org/post',
        model: FormListItemModel
    });
});

define('text!templates/requests-list-item.html',[],function () { return '<table class="request_table">\r\n    <thead>\r\n        <tr>\r\n            <td>#</td>\r\n            <td>Field Name</td>\r\n            <td>Field Value</td>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n    \t<% var idx = 0; for(var key in form) { %>\r\n\t    \t<tr>\r\n\t\t        <td><%= idx++ %></td>\r\n\t\t        <td><%= key %></td>\r\n\t\t        <td><%= form[key] %></td>\r\n\t        </tr>\r\n\t    <% } %>\r\n    </tbody>\r\n    <tfoot>\r\n        <tr>\r\n        \t<td colspan="3">\r\n        \t\t<button class="view">View</button>\r\n        \t\t<pre class="view_block">\r\n        \t\t\t<%= jsonParsed %>\r\n        \t\t</pre>\r\n        \t</td>\r\n        </tr>\r\n    </tfoot>\r\n</table>';});

define('views/RequestsListItemView',[
	'text!templates/requests-list-item.html',

    'marionette'
], function (
	template
) {
    return Backbone.Marionette.ItemView.extend({
    	tagName: 'li',
    	template: _.template(template),

        events: {
            'click .view': 'onClickView'
        },

        ui: {
            'viewBlock': '.view_block'
        },

        onClickView: function () {
            this.ui.viewBlock.toggle();
        }
    });
});
define('views/RequestsListCollectionView',[
	'App',
	'views/RequestsListItemView',

    'marionette'
], function (
	App,
	RequestsListItemView
) {
    return Backbone.Marionette.CollectionView.extend({
    	tagName: 'ul',
    	className: 'request_list',
		itemView: RequestsListItemView,

		initialize: function () {
			_.bindAll(this);

			App.vent.on('requestList:add', this.onRequestListAdd);
		},

		onRequestListAdd: function (data) {
			data.jsonParsed = JSON.stringify(data, '', 4);
			this.collection.add(data);
		}
	});
});
define('models/RequestsListItemModel',[
    'backbone'
], function () {
    return Backbone.Model.extend({});
});
define('collections/RequestsListCollection',[
    'models/RequestsListItemModel',

    'backbone'
], function (
    RequestsListItemModel
) {
    return Backbone.Collection.extend({
        model: RequestsListItemModel
    });
});
define('controllers/AppController',[
    'App',
    'views/FormListCollectionView',
    'collections/FormListCollection',
    'views/RequestsListCollectionView',
    'collections/RequestsListCollection',

    'marionette'
], function (
	App,
	FormListCollectionView,
	FormListCollection,
	RequestsListCollectionView,
	RequestsListCollection
) {
    return Backbone.Marionette.Controller.extend({
        initialize: function (options) {
        },

        index: function () {
        	App.formRegion.show(new FormListCollectionView({
        		collection: new FormListCollection([{}])
        	}));

        	App.listRegion.show(new RequestsListCollectionView({
        		collection: new RequestsListCollection()
        	}));
        }
    });
});
require([
    'App', 
    'routers/AppRouter', 
    'controllers/AppController',
    'marionette'
], function (
    App, 
    AppRouter, 
    AppController
) {
    App.appRouter = new AppRouter({
        controller: new AppController()
    });

    App.start();
});
define("main", function(){});

